    position: relative;
    margin-top: 20%;
    margin-left: 32%;
    /* top:350px;
    left: 525px; */

`

const LoadingIcon = styled.img`
`

function LoadingScreen()
{
    return(
    <LoadingContainer>
        <LoadingIcon src={loadingani} alt="loading..."/>
    </LoadingContainer>
    )
}

export default LoadingScreen
